import React, { useState } from 'react';


function ButtonSmallRowTable (props){

    const data = props.data;

    const buttonTrue = {
        flag: true,
        icon: "fa fa-filter fa-lg",
        name: 'addCompare',
        func: props.funcAdd
    };
    const buttonFalse = {
        flag: false,
        icon: "fa fa-times-circle",
        name: 'DeleteRow',
        func: props.funcDelete
    };

    return(
        <React.Fragment>
           
                <div 
                    className= {props.classname}

                    tabIndex = {props.tabindex}
                >    
                    <span
                            className={props.icon}
                            aria-hidden="true" 
                            onClick={(event) => props.onclick(event, data)}
                    >
                    </span>

                </div>

        </React.Fragment>
    )
}

export default ButtonSmallRowTable
